/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`%`*/ /*!50003 TRIGGER USER_INFO_after_update
AFTER UPDATE ON USER_INFO
FOR EACH ROW
  BEGIN
    DECLARE new_phone_number VARCHAR(13);
    DECLARE new_score_type BIT;
    DECLARE old_score BIGINT(20);
    DECLARE new_score BIGINT(20);
    DECLARE score_value BIGINT(20);

    IF OLD.CURRENT_DATETIME = NEW.CURRENT_DATETIME THEN
      SELECT NEW.PHONE_NUMBER INTO new_phone_number;
      SELECT OLD.PERSONAL_SCORE INTO old_score;
      SELECT NEW.PERSONAL_SCORE INTO new_score;
      SET score_value = new_score - old_score;

      IF score_value > 0 THEN
        SET new_score_type = 0;

        INSERT INTO SCORE_DETAIL (SAVING_TIME, PHONE_NUMBER, SCORE_TYPE, SCORE)
      VALUES (CURRENT_TIMESTAMP, new_phone_number, new_score_type, score_value);
      END IF;

      IF score_value < 0 THEN
        SET new_score_type = 1;

        INSERT INTO SCORE_DETAIL (SAVING_TIME, PHONE_NUMBER, SCORE_TYPE, SCORE)
      VALUES (CURRENT_TIMESTAMP, new_phone_number, new_score_type, score_value);
      END IF;
    END IF;
  END */;;
