	DECLARE new_event_type CHAR(1);
	DECLARE new_event_date CHAR(6);
	DECLARE new_event_number CHAR(2);
	DECLARE new_winning_number_1 INT(2);
	DECLARE new_winning_number_2 INT(2);
	DECLARE new_winning_number_3 INT(2);
	DECLARE new_winning_number_4 INT(2);
	DECLARE new_winning_number_5 INT(2);
	DECLARE new_winning_number_6 INT(2);
	DECLARE new_bonus_number INT(2);
	DECLARE new_prize_1 BIGINT(20);
	DECLARE new_prize_2 BIGINT(20);
	DECLARE new_prize_3 BIGINT(20);
	DECLARE new_prize_4 BIGINT(20);
	DECLARE new_prize_5 BIGINT(20);

   SELECT NEW.EVENT_TYPE INTO new_event_type;
   SELECT NEW.EVENT_DATE INTO new_event_date;
   SELECT NEW.EVENT_NUMBER INTO new_event_number;
   SELECT NEW.WINNING_NUMBER_1 INTO new_winning_number_1;
   SELECT NEW.WINNING_NUMBER_2 INTO new_winning_number_2;
   SELECT NEW.WINNING_NUMBER_3 INTO new_winning_number_3;
   SELECT NEW.WINNING_NUMBER_4 INTO new_winning_number_4;
   SELECT NEW.WINNING_NUMBER_5 INTO new_winning_number_5;
   SELECT NEW.WINNING_NUMBER_6 INTO new_winning_number_6;
   SELECT NEW.BONUS_NUMBER INTO new_bonus_number;
   SELECT NEW.PRIZE_1 INTO new_prize_1;
   SELECT NEW.PRIZE_2 INTO new_prize_2;
   SELECT NEW.PRIZE_3 INTO new_prize_3;
   SELECT NEW.PRIZE_4 INTO new_prize_4;
   SELECT NEW.PRIZE_5 INTO new_prize_5;
	   
   UPDATE PARTICIPATION AS A
	  LEFT JOIN (
	  SELECT TOT.EVENT_TYPE, TOT.EVENT_DATE, TOT.EVENT_NUMBER, TOT.PHONE_NUMBER,
	          CASE SUM(TOT.POINT) WHEN 6 THEN '1'
	          WHEN 5.5 THEN '2'
	          WHEN 5.0 THEN '3'
	          WHEN 4.5 THEN '4'
	          WHEN 4.0 THEN '4'
	          WHEN 3.5 THEN '5'
	          WHEN 3.0 THEN '5'
	          ELSE '9'
	          END AS WINNING_RATE
	  FROM (
	  SELECT 1 AS POINT, EVENT_TYPE, EVENT_DATE, EVENT_NUMBER, PHONE_NUMBER
	  FROM PARTICIPATION
	  WHERE WINNING_NUMBER_1 IN (new_winning_number_1,new_winning_number_2,new_winning_number_3,
	  									new_winning_number_4,new_winning_number_5,new_winning_number_6)
